import React from 'react';


import { Brand, Feature, Navbar} from './components';
import { Footer, Features, Header} from './containers';

import './App.css';

const App = () => (
  <div className = "row">
    <div className="App">
        <Navbar />
      <body>
        <Header />
      <Brand />
      <Feature />
      <Features />
      <Footer />
      </body>

    </div>
    </div>
  );

export default App;
